While reading some issues for Python I stumbled upon this weird `NaN` behaviour.

When supplying `NaN` to max or min, it will return `NaN` if it is the first argument:

```py
>>> max(float("NaN"), 1)
nan
>>> max(1, float("NaN"))
1
```

It's essentially to do with `NaN` always returning `False` in comparisons with other numbers:

```py
>>> float("NaN") < 1
False
>>> float("NaN") > 1
False
```

The implementation of both min and max take the first element as the current min/max value and then compare every other value with it. But since every other number returns `False` in that comparison, it will never change the current min/max value. The opposite is the case then `NaN` is in any other position, then the min/max value will never become `NaN`.

This alone might not be enough for a snippet, but I feel the implications for this when sorting lists are quite huge. Python's sort straight up **breaks** when there is a `NaN` value in the list:

```py
>>> sorted([3, 2, 1, float("NaN"), 1, 2, 3])
[1, 1, 2, 3, nan, 2, 3]  # ???
```

It seems to work correctly when `NaN` is at the front or the back of the list, but as soon as the `NaN` is somewhere in the middle it doesn't work most of the time. Timsort (and I assume algorithms such as quicksort and mergesort) struggle with that property of `NaN`. But even in selection sort it remains where it was, although the rest is at least sorted around it.

<details>
    <summary>Selection sort (<i>click to expand</i>)</summary>
    <!-- have to be followed by an empty line! -->

    def selection_sort(a):
        for i in range(len(a)):
            smallest_j = i
            for j in range(i+1, len(a)):
                if a[j] < a[smallest_j]:
                    smallest_j = j
            a[i], a[smallest_j] = a[smallest_j], a[i]
        return a

    mylist = [110, -1, 3, 2, 1, 20, float("NaN"), 100, 1, 2, 3]
    print(selection_sort(mylist))
    # [-1, 1, 1, 2, 2, 3, nan, 3, 20, 100, 110]
</details>

Unfortunately, `NaN`s are quite common in data science to show non-existing data. For example, when `pandas` encounters missing entries in a .csv file it automatically puts `NaN`s there. So, suppose you have a large dataset and only a few entries in it have `NaN`s, sorting it with python's sort function will look correct at the beginning, until it encounters a `NaN`, where all hell breaks loose, but you might not notice it if you only look at the start of the array. It feels like introducing bugs this way is quite easy.

You can sort it with both `pandas` or `numpy`, which then works correctly. However, if you do not know that `NaN` has this issue, you may not think about it:

```py
>>> import pandas as pd
>>> import numpy as np
>>> a = pd.Series([-1, -4, 3, -5, float("nan"), -2, 2, 4])
>>> a.sort_values()  # I believe it uses np.sort internally
3   -5.0
1   -4.0
5   -2.0
0   -1.0
6    2.0
2    3.0
7    4.0
4    NaN
dtype: float64
>>> np.sort(a)
array([-5., -4., -2., -1.,  2.,  3.,  4., nan])
>>> sorted(a)  # but Python's sort looks like this:
[-5.0, -4.0, -2.0, -1.0, 3.0, nan, 2.0, 4.0]
```

The status of this by the core developers of CPython as of 2019 was either "won't fix" or "not a bug" ([link](https://bugs.python.org/issue36095)). The main reason being that the IEEE has some odd definitions for `NaN`. However, as recently as two weeks ago this has been brought up again, and some developers are considering "biting the bullet" and changing this behaviour ([link](https://bugs.python.org/issue44370)). It remains to be seen if and when this changes, probably not that soon.

And for good measure, to further show that this is a wtf**python**, some other languages handle this more intuitively:

<details>
    <summary>JavaScript handles it well (<i>click to expand</i>)</summary>
    <!-- have to be followed by an empty line! -->

    >> Math.max(1, NaN)
    NaN
    >> Math.max(NaN, 1)
    NaN
    >> [3, 2, 1, NaN, 1, 2, 3].sort()
    [ 1, 1, 2, 2, 3, 3, NaN ]
</details>

<details>
    <summary>Java handles it well too (<i>click to expand</i>)</summary>
    <!-- have to be followed by an empty line! -->

    import java.util.Arrays;
    public class Main
    {
        public static void main(String[] args) {
            System.out.println(Math.max(1, Float.NaN));
            // prints: NaN
            
            System.out.println(Math.max(Float.NaN, 1));
            // prints: NaN
            
            float[] nums = new float[]{3, 2, 1, Float.NaN, 1, 2, 3};
            Arrays.sort(nums);
            System.out.println(Arrays.toString(nums));
            // prints: [1.0, 1.0, 2.0, 2.0, 3.0, 3.0, NaN]
        }
    }
</details>


<details>
    <summary>Rust avoids the issue somewhat (<i>click to expand</i>)</summary>
    <!-- have to be followed by an empty line! -->

    fn main() {
        let nan = std::f64::NAN;
        println!("{} {}", f64::max(1.0, nan), f64::max(nan, 1.0));
        // prints 1 1
        
        let vector = vec![3., 2., 1., nan, 1., 2., 3.];
        // vector.sort();
        // The above line would not compile, since f64 does not implement 
        // std::cmp::Ord, so it is not sortable.
        
        // This avoids the issue, but when people do want to sort such a list
        // they look for a solution online, finding a thread, which suggests
        // a custom comparator for f64 in the first comment. Then the second
        // comment points out that this does not work for NaN values. Then
        // the third comment shows a longer solution which does work for
        // NaN values...
        
        // For example: 
        // https://users.rust-lang.org/t/sorting-vector-of-vectors-of-f64/16264/2
    }
</details>

<details>
    <summary>C++ has the issue as well though (<i>click to expand</i>)</summary>
    <!-- have to be followed by an empty line! -->

    #include <iostream> // cout
    #include <vector> // vector
    #include <algorithm> // sort()
    #include <cmath> // sqrt()
    using namespace std;

    int main() {
        cout << sqrt(-1) << endl;   
        // prints: -nan
        
        cout << max(1.0, sqrt(-1)) << " " << max(sqrt(-1), 1.0) << endl;  
        // prints: 1 -nan
        
        vector<double> nums = {3., 2., 1., sqrt(-1), 1., 2., 3.};
        sort(nums.begin(), nums.end());
        for (auto i : nums)
            cout << i << " ";
        cout << endl;
        // prints: 1 2 3 -nan 1 2 3
    }
</details>

As far as I can tell there are no snippets and no issues/PRs discussing this. If you think this is fitting as a snippet I'd be happy to make a PR and add it (possibly after the `nan-reflexivity` snippet).

I looked around the project and did not find this, so I decided to work on a patch. I'm not sure I have a reasonable explanation for this behavior though:

Boolean operators almost never work with dicts like you would expect them to. I've seen a lot of people expect a boolean output such as:

```python
somedict = {}
if  somedict:
  print("false")

somedict = {"some": "thing"}
if somedict:
  print("true")
```

But that's not what really happens. Python is really wtfckery in this:

```
Python 3.8.3 (default, Feb  3 2021, 10:51:05)
[GCC 9.3.0] on linux
Type "help", "copyright", "credits" or "license" for more information.
>>> da = {"a": 1 }
>>> db = {"b": 2 }
>>> dc = {}
>>> dd = {}
>>> dc and dd
{}
>>> not dc and not dd
True
>>> not dc and dd
{}
>>> da and db
{'b': 2}
>>> da and dc
{}
>>> dc and da
{}
>>> db and da
{'a': 1}
>>> da and db and dc
{}
>>> dc and db and da
{}
>>> not da and dc
False
>>> not dc and da
{'a': 1}
>>> da or db
{'a': 1}
>>> dc or dd
{}
>>> da and db or dc
{'b': 2}
>>> da or db and dc
{'a': 1}
>>> da and db
{'b': 2}
>>> bool(da and db)
True
>>> dc = { "a": 1, "c": 3 }
>>> dc and da
{'a': 1}
>>> da and dc
{'a': 1, 'c': 3}
>>> da or dc
{'a': 1}
>>> dc or da
{'a': 1, 'c': 3}
>>>
```

So empty dicts return `False` alright, but dicts with keys return the dict itself, then `and` and `or` will work in completely unexpected ways, simply returning the first mentioned dict instead of doing anything with it. I'm not sure what is exactly happening down there and never really cared to know, but it's a weird behavior that sure deserve note.

Look that casting stuff to `bool` seems to work, but I remember stumbling into situations it didn't work as I expected at the time.
